if mibBuilder.loadTexts: atmIfVptUniSigAddressConversion.setDescription('This attribute specifies the address conversion on the outgoing signalling PDUs. The options are none, nativeE164, or nsap. The none option is the default and if this option is chosen then nothing is done to the address information element (IE) in the outgoing signalling message. If nativeE164 option is chosen, then only NSAP encapsulated E.164 addresses with zeros in the ESI are converted to native E.164 format in the outgoing signalling message. If the NSAP address is not encapsulated E.164 or the ESI field is not zeros and the nativeE164 option is chosen, then the call is cleared. If the nsap option is chosen, then native E.164 addresses are converted to NSAP E.164 with zeros in the ESI field; otherwise the address is in NSAP format and is not changed.')
